import React from "react";
import { Route } from "react-router-dom";

import { LoginForm } from "components";

const Auth = () => (
  <section className="auth">
    <div className="auth__content">
      <Route exact path={["/", "/login"]} component={LoginForm} />
    </div>
  </section>
);
